import { css } from "@emotion/react"

const Roulette = () => {
  const styles = {
    rouletteContainer: css`
      width: 100%;
    `,
    box: css`
      width: 80px;
      height: 80px;
    `,
    redBox: css`
      background-color: red;
    `,
    blackBox: css`
      background-color: black;
    `,
  }

  let rouletteAmount = 34
  let rouletteBoxes = []

  for (let i = 0; i < rouletteAmount; i++) {
    rouletteBoxes = [
      ...rouletteBoxes,
      <div css={[styles.box, styles.redBox]}></div>,
    ]
  }

  return (
    <div css={styles.rouletteContainer}>
      <div css={[styles.box, styles.redBox]}></div>
    </div>
  )
}

export default Roulette
